import React from "react";
import { Paper, Grid, Box } from "@material-ui/core";
import billboardPic from "../images/k.jpg";
import { matchPc, matchTablet } from "../DetectDevice";
import "./profile.css";
function Profile() {
  var widthh = matchPc ? "65.5vw" : "98vw";
  var topp = matchPc ? "2.8em" : matchTablet ? "3.5em" : "1.65em";
  var username = matchPc
    ? "usernamePc"
    : matchTablet
    ? "usernameTablet"
    : "usernameMobile";

  var widthName = matchPc ? "65.5vw" : "98vw";
  var topName = matchPc ? "8.8em" : matchTablet ? "11.3em" : "4em";
  var name = matchPc ? "namePc" : matchTablet ? "nameTablet" : "nameMobile";

  var widthFav = matchPc ? "65.5vw" : "98vw";
  var topName = matchPc ? "8.8em" : matchTablet ? "11.3em" : "4em";
  var name = matchPc ? "namePc" : matchTablet ? "nameTablet" : "nameMobile";

  return (
    <Paper>
      <Grid container style={{ height: "100vh" }}>
        <Grid
          item
          component={Box}
          display={{ xs: "none", md: "block" }}
          md={2}
        ></Grid>
        <Grid item xs={12} md={8}>
          <img
            className="turlight"
            style={{
              zIndex: 3,
              objectFit: "contain",
              width: "100%",
              borderRadius: "0px",
              borderBottomLeftRadius: matchPc ? "7px" : "0em",
              borderBottomRightRadius: matchPc ? "7px" : "0em",
              margin: "auto",
            }}
            src={billboardPic}
            alt="Superstarz Billboard Image"
          />
          {/*///////////////////////////////////////////////////////////////////////////USERNAME*/}
          <Grid
            item
            xs={12}
            style={{
              position: "absolute",
              width: widthh,
              height: "auto",
              top: topp,
              textAlign: "right",
              /// backgroundColor: "#00ccff",
              //center
            }}
          >
            <span className={`fontfamilyArial ${username} turlight`}>
              Ko Jamal
            </span>
          </Grid>
          {/*///////////////////////////////////////////////////////////////////////////USERNAME*/}

          {/*///////////////////////////////////////////////////////////////////////////FULLNAME OR QUOTES*/}
          <Grid
            item
            xs={12}
            style={{
              position: "absolute",
              width: widthName,
              height: "auto",
              top: topName,
              textAlign: "right",
              /// backgroundColor: "#00ccff",
              //center
            }}
          >
            <span className={`fontfamilyArial ${name} turlight`}>
              i love the summers so much
            </span>
          </Grid>
          {/*///////////////////////////////////////////////////////////////////////////FULLNAME OR QUOTES*/}

          {/*///////////////////////////////////////////////////////////////////////////FAVS*/}
          <Grid
            item
            xs={12}
            style={{
              position: "absolute",
              width: widthFav,
              height: "auto",
              top: "40px",
              textAlign: "right",
              /// backgroundColor: "#00ccff",
              //center
            }}
          >
            <span className={`fontfamilyArial ${name} turlight`}>11</span>
          </Grid>
          {/*///////////////////////////////////////////////////////////////////////////FAVS*/}
        </Grid>
      </Grid>
    </Paper>
  );
}

export default Profile;
